  html: "\r\n\t\t\t\r\n\t\t\t<!-- BEGIN TEMPLATE: bbcode_quote -->\n<div style=\"margin:20px; margin-top:5px; \">\r\n\t<div class=\"smallfont\" style=\"margin-bottom:2px\">Quote:</div>\r\n\t<table cellpadding=\"6\" cellspacing=\"0\" border=\"0\" width=\"100%\" class=\"voz-bbcode-quote\">\r\n\t<tr>\r\n\t\t<td class=\"alt2\" style=\"border:1px inset\">\r\n\t\t\t\r\n\t\t\t\t<div>\r\n\t\t\t\t\tOriginally Posted by <strong>nguoitomo</strong>\r\n\t\t\t\t\t<a href=\"showthread.php?p=72428623#post72428623\" rel=\"nofollow\"><img class=\"inlineimg\" src=\"images/buttons/viewpost.gif\" border=\"0\" alt=\"View Post\"></a>\r\n\t\t\t\t</div>\r\n\t\t\t\t<div style=\"font-style:italic\">C&#xF4; g&#xE1;i trong &#x1EA3;nh c&#x1EE7;a DuongQua l&#xE0;m m&#x169;i silicon r&#x1ED3;i</div>\r\n\t\t\t\r\n\t\t</td>\r\n\t</tr>\r\n\t</table>\r\n</div>\n<!-- END TEMPLATE: bbcode_quote -->Chu&#x1EA9;n , nh&#x1EEF;ng con m&#x169;i th&#x1EB3;ng &#x111;&#x1A1; &amp; ho&#x1EB7;c v&#x1EEB;a cao v&#x1EEB;a nh&#x1ECF; th&#xEC; PT 100%<br>\r\n<br>\r\nM&#x169;i PT &amp; g&#x1ECD;t c&#x1EB1;m .<br>\r\n<br>\r\n<img src=\"https://scontent-b-sjc.xx.fbcdn.net/hphotos-xaf1/v/t1.0-9/10734023_767460360000031_1648755561042632974_n.jpg?oh=a406693648243c12d84af4d14a5406d0&amp;oe=54D6A4BC\" border=\"0\" alt=\"\"><br>\r\n<br>\r\nC&#x1EB1;m t&#x1EF1; nhi&#xEA;n &amp; m&#x169;i t&#x1EF1; nhi&#xEA;n .<br>\r\n<br>\r\n<img src=\"https://scontent-b-sjc.xx.fbcdn.net/hphotos-xap1/v/t1.0-9/p370x247/10371484_598785850225929_3773604597329362001_n.jpg?oh=96a44dc54ecb39ec0655a8838e05c08c&amp;oe=54AAF01B\" border=\"0\" alt=\"\"><br>\r\n<br>\r\n<img src=\"https://fbcdn-sphotos-d-a.akamaihd.net/hphotos-ak-xpa1/v/t1.0-9/1450175_457877477650101_1077648016_n.jpg?oh=86c624c2e05eb3bd7946c09699da6ec6&amp;oe=54F061D8&amp;__gda__=1424610620_15657b54078d712c32cad7f7272675b3\" border=\"0\" alt=\"\">\r\n\t\t"
